    <h1 {...{
      "id": "getexecutiondetails"
    }}>{`getExecutionDetails`}</h1>
    <p>{`The function formats trade data for execution against the relevant Uniswap exchange.`}</p>
    <h2 {...{
      "id": "function-signature"
    }}>{`Function Signature`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`export function getExecutionDetails(
  trade: TradeDetails,
  maxSlippage?: number,
  deadline?: number,
  recipient?: string
): ExecutionDetails
`}</code></pre>
    <h2 {...{
      "id": "input-parameters"
    }}>{`Input Parameters`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Parameter`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Type`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`trade`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`TradeDetails`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`The trade to execute.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`maxSlippage?`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`number`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`The maximum slippage to allow, in basis points. Defaults to 200 `}{`(`}{`2%`}{`)`}{`.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`deadline?`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`number`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`When the transaction will expire. Defaults to 10 minutes in the future.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`recipient?`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`number`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`An optional recipient address. Defaults to the `}<inlineCode parentName="td">{`msg.sender`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "example-usage"
    }}>{`Example Usage`}</h2>
    <p>{`Method arguments are returned as one of: `}<inlineCode parentName="p">{`BigNumber`}</inlineCode>{`, `}<inlineCode parentName="p">{`number`}</inlineCode>{`, or `}<inlineCode parentName="p">{`string`}</inlineCode>{`. `}<inlineCode parentName="p">{`BigNumber`}</inlineCode>{`s are large number objects, `}<inlineCode parentName="p">{`numbers`}</inlineCode>{` are small numbers in base 10, and `}<inlineCode parentName="p">{`string`}</inlineCode>{`s are addresses.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`const tradeDetails: TradeDetails = tradeExactEthForTokensWithData(reserves, '1000000000000000000')

const executionDetails: ExecutionDetails = await getExecutionDetails(tradeDetails)

/*
{
  // the address of the relevant exchange
  exchangeAddress: 0x09cabEC1eAd1c0Ba254B09efb3EE13841712bE14,

  // the name of the method that must be called
  methodName: "ethToTokenSwapInput",

  // the id of the method name
  methodId: "0xf39b5b9b",

  // the ether value that must be sent with the transaction
  value: <BigNumber>,

  // method arguments as an array
  methodArguments: MethodArgument[]
}
*/
`}</code></pre>
    </MDXLayout>;
}

